INSERT INTO `system_messages` (`id`, `user_id`, `title`, `text`, `expires_at`, `page`, `created_at`, `updated_at`, `deleted_at`, `modal_class`, `only_for_admin`) VALUES
	(1, 1, 'Important Changes to the Functionality of the Availability Module', '<p style="margin-bottom: 0.5cm;">Important Changes to the Functionality of the Availability Module</p>\r\n<p style="margin-bottom: 0.5cm;">Attention! CWR Therapists! Please read!</p>\r\n<p style="margin-bottom: 0.5cm;">In efforts to adopt new standards and ensure compatibility with Tridiuum Platform we have made some changes to the way our Availability Module functions and it is important that you review the information provided below.</p>\r\n<p style="margin-bottom: 0.5cm;">As Tele health gained popularity throughout 2020, we have been closely following the standards set forth by the Tridiuum platform. Recently they have updated the system so that the users now are able to choose the type of availability they submit. Following options have been introduced in a form of checkboxes in Tridiuum Availability Calendar after a recent update. These are now a required to be selected in order to submit availability in Tridiuum:</p>\r\n<ol style="padding-left:15px;">\r\n<li>In Office <span style="padding-left:4px;">&ndash;</span> Available to meet the patient at the medical facility</li>\r\n<li>Virtual <span style="padding-left:16px;">&ndash;</span> Available for Telehealth session</li>\r\n<li>Both <span style="padding-left:27px;">&ndash;</span> This is not a listed option, but since options 1 &amp; 2 are selected via checkboxes, the user is not limited and can select both, implying that for this particular time slot he or she is available for either in office or telehealth visit.&nbsp;</li>\r\n</ol>\r\n<p style="margin-bottom: 0.5cm;">It is important to understand that Kaiser patients now have the options of selecting providers based on the availability type they submit. So if a patient is interested in the office visit and you only have Telehealth selected, the patient will be sent somewhere else.</p>\r\n<p style="margin-bottom: 0.5cm;">We have now introduced the same options in our system. Please note that initially you will have to set up your availability and check the appropriate types for yourself, and only after it is done once the feature to copy previous weeks availability will become available again.&nbsp;</p>\r\n<p style="margin-bottom: 0.5cm;">Thank you for your help and support. Please reach out to us if you have any questions.</p>\r\n<p style="margin-bottom: 0.5cm;">CWR Management&nbsp;&nbsp;</p>', '2020-12-19 17:55:50', 'doctor-availability', '2020-11-19 17:56:04', '2020-11-19 17:56:04', NULL, NULL, 0);
